import React from 'react';
import Header from './layout/header';
import './css/App.css';
import MovieList from './components/MovieList';
import Movie from './components/Movie';

function App() {
  const [movies, setMovies] = useState([])

  return (
    <>
    <Header></Header>
    <MovieList movies={movies}></MovieList>
    </>
  );
}

export default App;
